import React from 'react';
import happy from "../../../../Image/happy.jpg";
import "./About.css";


const About = () => {
    return ( 
        <div className="desc-body">
        <p>
          The newly released message application and still in the stage of
          testing the stability and feasibility of proper use by the
          Indonesian application research body
        </p>
        <img src={happy} className="img-fluid" width="200" alt=""/>
        </div>
     );
}

export default About;
